import logo from '../logo.svg';
import Img from './Img';
import './App.css';
import Menu from './menu/Menu';



const App = () => (
<Fragment>
  <Menu items={menuItem}/>
  <Img src={logo}/>
  <Img src={'https://st2.depositphotos.com/2001755/5408/i/450/depositphotos_54081723-stock-photo-beautiful-nature-landscape.jpg'}/>  
</Fragment>
);



export default App;
